import React, {Component} from 'react';
import PostData from './post.json';




class details extends Component{

constructor(props){
    super(props);
    this.state={
        data: PostData,
      }
    }


render() {
    return (
      <div>
        <h1>details page</h1>
        {PostData.map((Postdetails)=>{
            return <div>
                    <h2>{Postdetails.title}</h2>
                    </div>
            })}
      </div>
    )
  }
}

export default details;
